import React from 'react';
import './Body.css';



class Body extends React.Component {
    render(){
        return(
            <div className="content">
                <h2 className="sectionTitle">{this.props.title}</h2>
                <div className="divider">
                    <p><span><strong>We both swiped right</strong></span>
					and hopefully after some pleasant conversation there will be a date.
					Fingers crossed it's not something repetitive and generic.
					</p>
                </div>
                
            </div>
        )
    }
}

export default Body;
